INSERT INTO `summary_plan_day` VALUES (6, '2023-11-01', 1, 2, '/0/1/2/', '上午一个初诊多颗一个复诊全口均成交，全程陪同，种完陪患者挂盐水，下午参加市场大会，晚上打邀约初诊，送全口叔叔回家', '今日身体不舒服，明日休息，组内有个初诊，督促组员抓留存', '2023-11-01 22:23:19', '2023-11-01 22:23:19', 0, 0);
INSERT INTO `summary_plan_day` VALUES (7, '2023-11-02', 1, 2, '/0/1/2/', '今日休息，收回昨天全口欠款', '明天上午有一个初诊促成交，另有几个复诊患者要接待，下午打邀约，督促组员留存数量和质量', '2023-11-02 23:17:51', '2023-11-02 23:17:51', 0, 0);
INSERT INTO `summary_plan_day` VALUES (8, '2023-11-03', 1, 2, '/0/1/2/', '上午接待三个复诊患者，下午邀约初诊患者，安抚组员的半口戴牙患者，因为咬模没咬好，下次还要来试戴，督促组员邀约', '明天上午三个初诊，促成交，另有6个复诊患者要接待，督促组员打邀约，自己打回访', '2023-11-03 21:05:35', '2023-11-03 21:05:35', 0, 0);
INSERT INTO `summary_plan_day` VALUES (9, '2023-11-04', 1, 2, '/0/1/2/', '上午接待3个复查患者，下午去一个小区看望几位种牙患者，开发另外的患者，然后回到医院带初诊和复诊，因为ITI的价格比别的医院贵500没成交，后面推了诺贝尔患者回去考虑，督促组员邀约明日初诊', '明日组内有初诊，协助促成交，另有几位复查患者要接待，督促组员月初发力月底才不累', '2023-11-04 20:44:54', '2023-11-04 21:08:01', 0, 0);
INSERT INTO `summary_plan_day` VALUES (11, '2023-11-05', 1, 2, '/0/1/2/', '今日组内四个初诊一个复诊，协助接待均成交，另接待多个复查患者，有个患者戴牙已戴两次又没戴上，安抚患者。下午自己打邀约，督促组员邀约初诊', '明天自己有个复诊患者，促成交上半口，另有多个复查患者要接待，督促组员留存质量和数量', '2023-11-05 21:00:02', '2023-11-05 21:00:02', 0, 0);
INSERT INTO `summary_plan_day` VALUES (12, '2023-11-06', 1, 2, '/0/1/2/', '今日接待8位复诊患者，有三位等待时间过长，情绪波动有点大，安抚患者，全程陪同，另接待一位初诊患者，再回去跟其他医院对比一下价格，督促组员邀约初诊，留存', '明天有多位复查患者要接待，下午参加主管会和市场大会，晚上集体邀约初诊', '2023-11-06 21:36:25', '2023-11-06 21:36:25', 0, 0);
INSERT INTO `summary_plan_day` VALUES (13, '2023-11-07', 1, 2, '/0/1/2/', '今日接待一个初诊和多个复诊患者，上午一个戴牙又没戴上，安抚患者，下午开主管会和市场大会，晚上集体打邀约', '明日组内有初诊，协助促成交，另需接待几个复查患者，督促组员的留存邀约，没初诊的现场抓初诊', '2023-11-07 21:36:00', '2023-11-07 21:36:00', 0, 0);
INSERT INTO `summary_plan_day` VALUES (14, '2023-11-08', 1, 2, '/0/1/2/', '今天上午接待组员一个初诊，协助已成交，今天手术了，等待时间很长，安抚患者情绪，另一个组员的半口也谈好，周五来做，接待多个复诊，一个活动牙来了两次没戴上不满意，另一个做完二期出血比较多，等待时间很长，安抚患者，督促组员留存初诊', '组内有初诊，协助促成交，另需接待多个复诊患者，下午打邀约初诊，督促组员邀约', '2023-11-08 21:36:48', '2023-11-08 21:36:48', 0, 0);
INSERT INTO `summary_plan_day` VALUES (15, '2023-11-09', 1, 2, '/0/1/2/', '今天自己有三个初诊一个复诊，都没成交，都是转介绍，两个是因为价格回去考虑对比，另外两个回去跟家人商量，要父母做主，组员的成交了三个，还有一个因为预算太低没成交，另接待了四个复查患者，督促组员留存邀约初诊', '明天上午有多个复查患者要接待，下午忙完去场地看新人，督促组员的留存质量和数量', '2023-11-09 21:03:58', '2023-11-09 21:03:58', 0, 0);
INSERT INTO `summary_plan_day` VALUES (16, '2023-11-10', 1, 2, '/0/1/2/', '上午协助组员两个复诊患者成交，接待六个复查患者，下午接待自己一个复诊患者谈单成交，打回访电话，晚上协助组员一个初诊成交，另外两个复诊患者后期也还有好多颗牙要种。督促组员利用双11活动全力邀约', '明天上午接待几个复查患者，开发转介绍，下午打邀约，晚上有个复诊患者来再次了解方案和价格', '2023-11-10 18:57:44', '2023-11-10 18:57:44', 0, 0);
INSERT INTO `summary_plan_day` VALUES (17, '2023-11-11', 1, 2, '/0/1/2/', '今天上午接待多个复查患者，另协同接待组员的三个初诊患者和复诊患者，有个回去考虑，因为价格，自己谈单复诊患者成交，督促组员利用活动邀约', '明日组内有个初诊和复诊，协助促成交，另要接待多个复查患者，督促组员没初诊的现场抓初诊', '2023-11-11 21:47:38', '2023-11-11 21:47:38', 0, 0);
INSERT INTO `summary_plan_day` VALUES (18, '2023-11-12', 1, 2, '/0/1/2/', '明天上午接待两个初诊一个半口复诊，促成交，另需接待陪同多个复查患者，督促组员全力邀约', '今天上午接待一个复诊患者，由于预算太低，谈了很长时间，最终奥齿泰成交，另协助接待组员半口补款安排手术，谈单组员一个复诊全科改种植方案，陪同接待多个复查患者，晚上自己打邀约及回访，督促组员邀约', '2023-11-12 21:16:57', '2023-11-12 21:16:57', 0, 0);
INSERT INTO `summary_plan_day` VALUES (19, '2023-11-13', 1, 2, '/0/1/2/', '上午接待两个复诊一个初诊均成交，陪同复诊患者半口手术，晚上七点多戴牙结束，另接待五个复查患者，打回访及邀约电话，督促组员邀约', '明天接待一个拆线三个戴牙患者，下午参加主管会和市场大会，晚上集体打邀约', '2023-11-13 20:09:43', '2023-11-13 20:09:43', 0, 0);
INSERT INTO `summary_plan_day` VALUES (20, '2023-11-14', 1, 2, '/0/1/2/', '今天上午接待五个复诊患者，两个全口临时牙掉了的，补临时牙，下午开主管会和市场大会，晚上集体邀约明日初诊', '明天上午和组员参加一个社区活动，下午接待复诊患者，打回访电话', '2023-11-14 21:06:07', '2023-11-14 21:06:07', 0, 0);
INSERT INTO `summary_plan_day` VALUES (21, '2023-11-15', 1, 2, '/0/1/2/', '早上陪前天成交的患者手术，然后协助组员接待两个初诊，一个成交一个回去考虑，中午去参加社区活动，下午回医院接待几个复查患者，晚上打回访电话，督促组员邀约', '明日休息，督促组员留存及邀约', '2023-11-15 20:07:38', '2023-11-15 20:07:38', 0, 0);
INSERT INTO `summary_plan_day` VALUES (22, '2023-11-16', 1, 2, '/0/1/2/', '今日休息，督促组员邀约', '明天组员有初诊，协助接待促成交，另有八个复查患者需接待，督促没初诊的现场抓初诊', '2023-11-16 20:54:02', '2023-11-16 20:54:02', 0, 0);
INSERT INTO `summary_plan_day` VALUES (23, '2023-11-17', 1, 2, '/0/1/2/', '今日接待9位复查患者，一个半口戴牙没戴上，另接待两名初诊患者，一个成交一个回去商量，督促组员邀约初诊，尽快完成任务', '明天上午两个复查患者，另有一个初诊，促成交，下午去场地留存，查看组员状态', '2023-11-17 20:42:08', '2023-11-17 20:42:08', 0, 0);
INSERT INTO `summary_plan_day` VALUES (24, '2023-11-18', 1, 2, '/0/1/2/', '今日接待四个复查患者，接待自己一个初诊，协同接待组员一个初诊预算太低没成交，晚上打邀约初诊和回访电话，督促组员邀约及留存', '明天接待多个复查患者，其中一个半口戴牙，初诊促成交，督促组员现场抓初诊', '2023-11-18 20:30:56', '2023-11-18 20:30:56', 0, 0);
INSERT INTO `summary_plan_day` VALUES (25, '2023-11-19', 1, 2, '/0/1/2/', '上午在医院接待一个复诊一个初诊和三个复查患者，复诊全口成交，全程陪同患者，下午接待一位初诊，回去和家人商量，陪同一个患者半口戴牙，没戴上，督促组员邀约', '明天多个复查患者要接待，下午打回访及邀约，督促组员抓紧时间冲刺', '2023-11-19 19:12:07', '2023-11-19 19:12:07', 0, 0);
INSERT INTO `summary_plan_day` VALUES (26, '2023-11-20', 1, 2, '/0/1/2/', '早上去看望患者，然后去场地查看组员工作状态，中午回门诊带5个复查和复诊患者，有个患者套冠的又没戴上牙，安抚患者.督促组员留存', '上午接待几个复查患者，下午参加主管会和市场大会，制定下周目标，晚上集体邀约', '2023-11-20 21:08:35', '2023-11-20 21:08:35', 0, 0);
INSERT INTO `summary_plan_day` VALUES (27, '2023-11-21', 1, 2, '/0/1/2/', '今日接待五个复查患者，下午参加主管会制定最后九天目标，然后参加市场大会，晚上集体邀约明日初诊', '上午有初诊接待促成交，另要接待多个复查患者，下午去探望之前老患者开发转介绍，督促组员邀约及留存', '2023-11-21 21:07:01', '2023-11-21 21:07:01', 0, 0);
INSERT INTO `summary_plan_day` VALUES (28, '2023-11-22', 1, 2, '/0/1/2/', '早上接待一个初诊，上半口缺失，去了很多医院，骨头很不好，属于特殊病例，回去考虑，另接待几个复查患者，有个患者上基台时植体掉出来了，安抚患者，下午跟组员去社区做义诊，督促组员留存及邀约', '明天上午接待几个复查患者，一个是全口戴完牙一直觉得不舒服要求重做，组内有初诊协助接待促成交。督促组员没初诊的现场抓初诊。', '2023-11-22 21:08:48', '2023-11-22 21:09:15', 0, 0);
INSERT INTO `summary_plan_day` VALUES (29, '2023-11-23', 1, 2, '/0/1/2/', '今天上午接待4个复查患者，一个全口戴牙后不舒服来调牙，全程陪同沟通，一个昨天套冠后冠掉了今天来重新粘，下午去看望患者开发转介绍，督促组员留存和邀约，晚上开会培训消防安全知识', '明天上午去场地带教新人，中午回门诊有复诊促成交，下午去场地留存，打回访及邀约，督促组员留存及邀约', '2023-11-23 22:07:20', '2023-11-23 22:07:20', 0, 0);
INSERT INTO `summary_plan_day` VALUES (30, '2023-11-24', 1, 2, '/0/1/2/', '今天上午去场地带教新人，中午回门诊带复诊成交，接待复查患者，下午打回访及邀约，督促组员留存及邀约', '明天带之前种过半口的叔叔参加半全口讲座活动，协助组员半口促成交，需接待多名复查患者，下午督促组员打邀约，努力冲刺', '2023-11-24 20:57:30', '2023-11-24 20:57:30', 0, 0);
INSERT INTO `summary_plan_day` VALUES (31, '2023-11-25', 1, 2, '/0/1/2/', '接待5个复查患者，协助组员接待2个初诊患者，都没成交，回去考虑对比，下午打回访及邀约，督促组员打邀约努力冲刺', '早上组内有初诊，协助促成交，另有7个复查患者接待，督促组员没初诊的现场抓初', '2023-11-25 21:11:42', '2023-11-25 21:11:42', 0, 0);
INSERT INTO `summary_plan_day` VALUES (32, '2023-11-26', 1, 2, '/0/1/2/', '接待七个复查患者，一个掉牙粒的，上午接待两个初诊患者，回去和家人商量，合适就这几天过来种，跟进，下午接待一个初诊半口成交，全程陪同，种完血压一直过高，浙二不让阿姨挂盐水和离开医院，等到很晚才能戴牙，督促组员邀约', '明天早上接待两位复查患者戴牙，有个患者另外几颗牙也不好了，尽量让叔叔明天把另几颗也种了，下午接待一个初诊促成交，早上，打邀约及回访，督促组员邀约及留存质量', '2023-11-26 21:05:40', '2023-11-26 21:05:40', 0, 0);
INSERT INTO `summary_plan_day` VALUES (33, '2023-11-27', 1, 2, '/0/1/2/', '上午接待三个复查患者，一个本来约了做二期，来看了还不能做，还有一个戴牙，还有另外几颗没种，因为骨头太差，需要大膜大粉外提，患者觉得有点贵回去考虑，也回去适应一下刚戴的牙怎么样，下午接待一个初诊，半口回去和儿子商量，要儿子做主，另接待一个全口患者拆线调牙，晚上打回访及邀约，督促组员努力冲刺', '明天上午去场地带新人，下午回医院开会，晚上集体邀约初诊确定月底前能来的患者', '2023-11-27 20:34:30', '2023-11-27 20:34:30', 0, 0);
INSERT INTO `summary_plan_day` VALUES (34, '2023-11-28', 1, 2, '/0/1/2/', '上午去场地带新人，下午回医院开主管会，定最后两天冲刺目标，接待一个复查患者种之前延期的一颗牙，参加市场大会，晚上和组员一起邀约初诊', '明天上午有一个初诊，接待促成交，另有三位戴牙患者接待，下午有个复诊促成交，督促组员现场邀约', '2023-11-28 21:02:43', '2023-11-28 21:02:43', 0, 0);
INSERT INTO `summary_plan_day` VALUES (35, '2023-11-29', 1, 2, '/0/1/2/', '今天上午接待一个初诊一个复诊均成交，初诊本来可以种半口，因为刚中风几个月患者担心自己身体吃不消先种三颗，后期跟进，复诊的先种一边，想戴好牙了种另一边，下午协助组员接待两个初诊谈单一个复诊，成交两个，还有个需要回去和家人商量，另接待4个戴牙患者，晚上督促组员打邀约全力冲刺，自己打邀约及回访', '上午自己有三个初诊接待促成交转介绍的，争取突破80，另接待五个做二期的，一个全口调牙的，督促组员现场抓初诊，努力冲刺', '2023-11-29 20:51:07', '2023-11-29 20:52:37', 0, 0);
INSERT INTO `summary_plan_day` VALUES (36, '2023-11-30', 1, 2, '/0/1/2/', '今天上午接待两个初诊，因为夫妻两个人需要回家对比没成交，接待一个客诉，半口戴完牙三个月后基台外露，最终加工厂给的方案是给患者送个冲牙器，另接待两个全口调牙，陪同安排五个患者做二期上基台，晚上处理一个客诉下午种进去的晚上非要取出来，觉得种歪了，非常不讲理，完全不听说，晚上开会制定下月目标', '明日休息', '2023-11-30 20:03:53', '2023-11-30 20:03:53', 0, 0);
INSERT INTO `summary_plan_day` VALUES (37, '2023-12-01', 1, 2, '/0/1/2/', '今日发烧感冒休息', '休息，督促组员留存邀约初诊', '2023-12-01 21:09:43', '2023-12-01 21:09:43', 0, 0);
INSERT INTO `summary_plan_day` VALUES (38, '2023-12-02', 1, 2, '/0/1/2/', '感冒发烧休息，督促组员邀约初诊，组员有个初诊回家跟家人商量，家人同意下周就来', '明天有两个初诊，接待促成交，另有四个复查患者需接待，有一个上了基台反复疼肿，明天再来检查。督促组员邀约，下午去场地带新人', '2023-12-02 20:37:05', '2023-12-02 20:37:05', 0, 0);
INSERT INTO `summary_plan_day` VALUES (39, '2023-12-03', 1, 2, '/0/1/2/', '上午接待四个初诊患者，有一个需要儿子出钱，回去跟儿子商量，另外一个觉得贵想回江西老家做，还有一个交了定金回去和家人商量下。另接待三个复查患者，一个本来来取模，发现牙龈一直红肿，重新换基台，觉得可能是基台高了，安抚患者。督促组员邀约', '明天上午接待几个复查患者和一个延期种植的，陪同安排手术，下午去场地留存，打回访及邀约，督促组员现场抓初诊，月初不放松，月底才轻松', '2023-12-03 20:59:28', '2023-12-03 21:03:01', 0, 0);
INSERT INTO `summary_plan_day` VALUES (40, '2023-12-04', 1, 2, '/0/1/2/', '今日上午接待一个复诊补种两颗奥齿泰，等待时间很长，安抚患者，还有两颗下次种，另接待三个复查患者，下午打回访及邀约，督促组员邀约初诊', '明天上午接待两个复查患者，一个戴了活动牙感觉不好用吃不了东西，想重做，下午参加市场大会，晚上集体打邀约初诊', '2023-12-04 21:38:15', '2023-12-04 21:38:15', 0, 0);
INSERT INTO `summary_plan_day` VALUES (41, '2023-12-05', 1, 2, '/0/1/2/', '上午去场地带新人，中午回医院安排复查患者，接待初诊陪同手术，下午参加主管会统计上个月月底冲刺业绩，参加市场大会，晚上集体邀约初诊', '明天组里两个初诊，协助接待促成交，另有三个复查患者需接待，下午去场地留存，督促组员邀约留存', '2023-12-05 21:11:12', '2023-12-05 21:11:12', 0, 0);
INSERT INTO `summary_plan_day` VALUES (42, '2023-12-06', 1, 2, '/0/1/2/', '今日身体不适休息，组内两个初诊都没成，回去考虑，有一个就洗了牙，督促组员邀约', '早上接待一个拔牙延期患者手术，另需安排四个复查患者，一个戴牙，一个半口拆线调牙，一个半口取模，一个根管治疗，下午去场地留存，督促组员留存及邀约', '2023-12-06 19:48:15', '2023-12-06 19:48:15', 0, 0);
INSERT INTO `summary_plan_day` VALUES (43, '2023-12-07', 1, 2, '/0/1/2/', '上午接待初诊，没成交，因为牙疼，回家要吃消炎药不疼了再考虑，还要跟老伴商量.争取下个礼拜约过来。另接待一个半口取模，患者还有下半口没种，铺垫跟进患者考虑中，尽量让患者早点种。另接待一个戴牙患者比较满意。下午接待一个根管治疗等待时间过长，安抚患者。接待一个半口拆线调牙，开发上半口，患者因为工作请不了假，等放假来种，接待陪同一个延期种植患者手术。晚上督促组员邀约初诊，自己打回访及邀约', '明天上午接待陪同一个半口戴牙和另一个多颗戴牙，下午去场地留存，查看组员状态，督促组员邀约', '2023-12-07 21:14:30', '2023-12-07 21:14:30', 0, 0);
INSERT INTO `summary_plan_day` VALUES (44, '2023-12-08', 1, 2, '/0/1/2/', '上午接待一个半口试戴牙，一个复诊患者牙疼发炎，回去吃药不疼了再来拔牙。下午去社区谈活动，督促组员邀约初诊', '明天上午接待两个复诊半口患者促成交，协助组员接待一个半口复诊促成交，督促没初诊的现场抓初诊', '2023-12-08 20:36:24', '2023-12-08 20:36:24', 0, 0);
INSERT INTO `summary_plan_day` VALUES (45, '2023-12-09', 1, 2, '/0/1/2/', '上午接待两个复诊半口患者成交，陪同患者戴牙，协助组员半口患者成交，下午接待三个初诊，在意价格，要多家对比，顶多只能接受奥齿泰，另接待三个复查患者，督促组员留存及邀约', '上午去场地留存，另需接待四个复查患者，督促组员现场抓初诊', '2023-12-09 21:31:16', '2023-12-09 21:31:16', 0, 0);
INSERT INTO `summary_plan_day` VALUES (46, '2023-12-10', 1, 2, '/0/1/2/', '上午去场地留存，安排几个复查患者，下午去看望几个半口全口患者，沟通让患者这个月尽量把下半口种了，开发转介绍，跟社区谈合作，安排一个戴牙患者没戴上。督促组员邀约', '上午接待一个全口患者调牙，牙龈痛，给新人培训，下午接待陪同一个全口戴牙，接待一个全口阿姨重新取模，督促组员现场抓初诊', '2023-12-10 20:52:23', '2023-12-10 20:52:23', 0, 0);
INSERT INTO `summary_plan_day` VALUES (47, '2023-12-11', 1, 2, '/0/1/2/', '上午接待一个全口调牙，把临时牙取下来重新磨了下，感觉太厚不舒服，牙龈疼，接待一个全口重新取模，戴完牙多次来调还是不舒服要求重做，给新人培训。下午接待一个全口戴牙，非常满意，接待一个患者戴牙沟通另外几颗牙也尽量早点种，晚上接待一个半口戴牙，跟进开发另外半口早点种。自己打回访及邀约，督促组员留存', '明天上午参加社区活动，下午回门诊开主管会和市场大会，晚上集体邀约初诊', '2023-12-11 20:32:35', '2023-12-11 20:32:35', 0, 0);
INSERT INTO `summary_plan_day` VALUES (48, '2023-12-12', 1, 2, '/0/1/2/', '上午参加社区活动，安排两个患者做二期，中午回院接待全口粘牙粒，安抚患者，牙粒多次掉不满意，下午参加市场大会，督促组员邀约初诊，自己打回访及邀约，接待患者戴牙，等待时间长安抚患者换医生，协同接待组员初诊成交', '上午去场地留存带新人，下午回医院接待两个复查患者，督促组员现场抓初诊', '2023-12-12 21:03:04', '2023-12-12 21:03:04', 0, 0);
