INSERT INTO `summary_plan_day` VALUES (59, '2023-12-23', 1, 2, '/0/1/2/', '上午接待陪同一个全口雅定的重新戴牙，回去再试试看，下午接待陪同三个患者戴牙，两个二期，接待组员患者拆线沟通再种三颗，患者因为银行卡冻结要下个月再种，督促组员邀约初诊', '明日有事休息，上午去医院陪同半口患者拆线调牙，接待一个戴牙后疼痛患者，下午接待一个患者戴牙后疼痛，另外还要套几颗冠，沟通看能否成交，督促组员邀约', '2023-12-23 20:59:41', '2023-12-23 20:59:41', 0, 0);
