INSERT INTO `summary_plan_day` VALUES (64, '2023-12-28', 1, 2, '/0/1/2/', '上午一个复诊全口患者特意来医院看别的患者做半口手术后的反映和效果，全程陪同和讲解，协助接待组员的初诊成交，接待5个复查患者。督促组员邀约，打邀约及回访', '明天接待几个复查患者，督促组员抓紧邀约冲刺，下午去查看组员状态及拜访老患者', '2023-12-28 21:04:09', '2023-12-28 21:04:09', 0, 0);
