INSERT INTO `summary_plan_day` VALUES (72, '2024-01-05', 1, 2, '/0/1/2/', '接待多个复查患者，有初诊促成交。督促组员现场邀约', '组内四个初诊，协助接待，两个成交，一个全口一个多颗，两个未成交，一个要出去旅游，想回来后再来，另一个在别的医院种完半口来我们医院比较想种另外半口，结果价格有差距，回去考虑对比。督促组员继续跟进。接待几个复查患者。督促组员邀约', '2024-01-05 21:33:31', '2024-01-05 21:33:31', 0, 0);
INSERT INTO `summary_plan_day` VALUES (73, '2024-01-06', 1, 2, '/0/1/2/', '上午接待多名复查患者，一个戴完牙不舒服返工取模，另一个因为缺牙对颌牙伸长无法戴牙又重取模，另外几个二期戴牙的，早上一个初诊因为牙龈萎缩的厉害没办法做。下午带组员去社区留存。', '明天需要接待多个复查患者，一个半口牙粒掉了粘牙粒的。下午去场地留存，督促组员邀约', '2024-01-06 21:07:41', '2024-01-06 21:07:41', 0, 0);
INSERT INTO `summary_plan_day` VALUES (74, '2024-01-07', 1, 2, '/0/1/2/', '上午接待多个复查患者，一个半口粘牙粒，一个取模的时候植体脱落，下午接待一个初诊，要回去和家人商量，督促组员邀约', '上午有初诊促成交，接待一个半口取模，一个半口戴牙，下午接待几个咬模和戴牙，督促组员邀约', '2024-01-07 20:31:32', '2024-01-07 20:31:32', 0, 0);
INSERT INTO `summary_plan_day` VALUES (75, '2024-01-08', 1, 2, '/0/1/2/', '上午初诊成交半口，全程陪同戴牙挂盐水，一个半口试戴牙，下午接待几个咬模和戴牙，一个患者在戴牙时植体脱落，安抚患者，告知养四到五个月再种，督促组员邀约', '明天有初诊促成交，接待四个戴牙患者，一个戴完不舒服调牙的，督促组员邀约', '2024-01-08 20:40:34', '2024-01-08 20:40:34', 0, 0);
INSERT INTO `summary_plan_day` VALUES (76, '2024-01-09', 1, 2, '/0/1/2/', '上午接待三个初诊一个复诊，成交一个半口奥齿泰，患者血压偏高等到很晚才手术，术后反应偏大，全程陪同，有个未成交要去植成比较，觉得我们这价格偏贵。接待几个戴牙患者。下午参加市场大会，邀约初诊', '明天接待9个复查患者，一个初诊，半口试戴督促组员邀约', '2024-01-09 21:49:41', '2024-01-09 21:49:53', 0, 0);
INSERT INTO `summary_plan_day` VALUES (77, '2024-01-10', 1, 2, '/0/1/2/', '接待9个复查患者，协助组员接待一个初诊，患者回去和家人商量，定了后天早上和孩子一起来，督促组员邀约，自己打回访及邀约', '上午去场地查看组员状态，下午回医院接待复查患者，一个半口戴牙后疼痛过来调牙，督促组员留存质量和数量', '2024-01-10 21:56:26', '2024-01-10 21:56:26', 0, 0);
INSERT INTO `summary_plan_day` VALUES (78, '2024-01-11', 1, 2, '/0/1/2/', '上午去场地查看组员状态，带教新人，帮助留存，下午去转场地，督促组员留存，安排几个复查患者，督促组员邀约', '上午接待一个全口咬模，组内有初诊促成交，下午去场地留存，督促组员现场邀约', '2024-01-11 21:40:50', '2024-01-11 21:40:50', 0, 0);
INSERT INTO `summary_plan_day` VALUES (79, '2024-01-12', 1, 2, '/0/1/2/', '上午协助组员接待一个初诊，交了定金拔了牙过几天来种，接待自己一个初诊，情况比较复杂，吃了骨质疏松的药，经过多方询问商量决策最终种了两颗.晚上接待一位种牙后对颌牙伸长导致不能戴牙，经过三位医生商讨决定年后再改方案治疗。晚上门诊一起开会沟通平时遇到的问题', '明天接待一个患者返工戴牙的，另接待三个戴牙的，督促组员邀约', '2024-01-12 21:54:26', '2024-01-12 21:54:26', 0, 0);
