INSERT INTO `summary_plan_day` VALUES (82, '2024-01-15', 1, 2, '/0/1/2/', '今日陪一个全口阿姨返工咬模，弄了一整天，安抚阿姨，阿姨多次来医院没调好，希望这次能满意。督促组员邀约，自己打回访及邀约', '组内有初诊，跟进促成交，下午市场大会邀约初诊', '2024-01-15 21:01:36', '2024-01-15 21:01:36', 0, 0);
INSERT INTO `summary_plan_day` VALUES (83, '2024-01-16', 1, 2, '/0/1/2/', '明天上午去场地留存，下午回医院带复诊患者。跟进组员初复诊情况', '上午在场地带教新人，中午回医院带复查患者全口粘牙粒，下午开主管会，总结前半个月业绩，最后半个月冲刺，晚上带领组员打邀约', '2024-01-16 21:54:53', '2024-01-16 21:54:53', 0, 0);
