INSERT INTO `summary_plan_day` VALUES (86, '2024-01-19', 1, 2, '/0/1/2/', '上午接待昨天成交的两个患者手术，接待多个复查患者.接待两个初诊，一个复诊，下午陪同患者挂盐水，晚上陪同全口戴牙，比较满意，督促组员最后冲刺', '上午接待一个复查患者，戴牙后调整多次后又返工现在还是不舒服.再来调整，下午接待一个半口调牙和戴牙，督促组员邀约', '2024-01-19 20:51:10', '2024-01-19 20:53:53', 0, 0);
