INSERT INTO `summary_plan_day` VALUES (108, '2024-02-28', 1, 2, '/0/1/2/', '上午带初诊和复诊，初诊未成交，要多家医院对比价格，中午去场地留存带新人，下午辅助新人邀约初诊未成交。督促组员留存及邀约，2最后一天冲刺', '上午去拜访老患者，给我两个转介绍要我去做详细讲解，督促组员留存及邀约', '2024-02-28 21:39:09', '2024-02-28 21:39:09', 0, 0);
