INSERT INTO `summary_plan_day` VALUES (110, '2024-03-01', 1, 2, '/0/1/2/', '上午接待两个初诊，成交一个半口，另一个想等家属做好了再做，接待五个复查患者，协助组员初诊成交，下午接待一个初诊，要回去和家人商量，晚上陪患者挂盐水戴牙，督促组员邀约明日初诊，月初发力，月底满意', '上午接待复诊，组内有初诊促成交，下午场地查看组员状态，督促留存及邀约', '2024-03-01 19:49:43', '2024-03-01 19:49:43', 0, 0);
INSERT INTO `summary_plan_day` VALUES (111, '2024-03-02', 1, 2, '/0/1/2/', '上午在医院带复诊，随后给患者送磨牙垫，下午去场地留存，督促组员邀约', '上午接待初诊患者，下午场地留存，督促组员留存及邀约', '2024-03-02 20:13:57', '2024-03-02 20:13:57', 0, 0);
INSERT INTO `summary_plan_day` VALUES (112, '2024-03-03', 1, 2, '/0/1/2/', '上午带初诊骨头条件不好，需要拔牙延期种植，接待复诊患者，下午场地留存，晚上回院开会。督促组员邀约初诊', '上午接待复诊患者，三个二期，一个全口牙粒掉了粘牙粒，下午场地留存，查看组员工作状态，督促留存及邀约', '2024-03-03 21:10:38', '2024-03-03 21:10:38', 0, 0);
INSERT INTO `summary_plan_day` VALUES (113, '2024-03-04', 1, 2, '/0/1/2/', '上午在医院接待四个复查患者，三个二期，一个全口粘牙粒，由于等待时间有点长，患者走了没粘，一个二期患者二开两颗牙冠，下午在场地带组员留存，督促组员邀约', '上午接待复查患者，初诊促成交，下午去场地留存，督促没初诊的现场邀约', '2024-03-04 20:28:32', '2024-03-04 20:28:32', 0, 0);
INSERT INTO `summary_plan_day` VALUES (114, '2024-03-05', 1, 2, '/0/1/2/', '上午接待四个复查患者和2个初诊患者，成交一个，还有一个需要回去和家人商量，在意价格，下午协助组员接待两个初诊，成交一个，另一个未成交，需要回去考虑，后期跟进。督促组员邀约明日初诊', '上午接待两个复查患者和两个初诊患者，组员也有初诊，协助促成交。督促没初诊的现场邀约初诊', '2024-03-05 20:36:48', '2024-03-05 20:36:48', 0, 0);
INSERT INTO `summary_plan_day` VALUES (115, '2024-03-06', 1, 2, '/0/1/2/', '上午接待两个初诊成交，接待两个复查患者咬模，下午协助组员接待三个初诊一个复诊，成交两个，还有两个未成，回家考虑对比。下午去组员场地查看组员工作状态，督促留存及邀约', '上午组内有初诊，帮助组员接待初诊促成交，下午接待复查患者，督促组员不松懈，严抓留存质量', '2024-03-06 21:42:27', '2024-03-06 21:42:27', 0, 0);
INSERT INTO `summary_plan_day` VALUES (116, '2024-03-07', 1, 2, '/0/1/2/', '协助组员接待四个初诊，成交3个，阿姨叔叔都比较胆小，全程陪同，晚上戴完牙非常满意，督促组员现场邀约', '接待三个返工患者，协助组员接待初诊促成交，督促组员留存及邀约', '2024-03-07 21:06:35', '2024-03-07 21:06:35', 0, 0);
INSERT INTO `summary_plan_day` VALUES (117, '2024-03-08', 1, 2, '/0/1/2/', '上午协助组员接待一个初诊未成交，要回去考虑，觉得价格贵，接待四位复查患者调牙，两个取模，下午打邀约回访，督促组员留存及邀约', '上午协助组员接待两个初诊促成交，接待五个复查患者，一个半口重新取模。督促组员现场邀约', '2024-03-08 21:42:59', '2024-03-08 21:42:59', 0, 0);
INSERT INTO `summary_plan_day` VALUES (118, '2024-03-09', 1, 2, '/0/1/2/', '接待六个复查患者，一个半口返工取模重新换基台，弄了一上午，取了几次，患者有情绪了，安抚患者，下午接待一个种植体松动裂了的，还有几颗要种，跟进开发，督促组员留存及邀约。自己打邀约', '接待六个复查患者，一个半口返工取模重新换基台，弄了一上午，取了几次，患者有情绪了，安抚患者，下午接待一个种植体松动裂了的，还有几颗要种，跟进开发，督促组员留存及邀约。自己打邀约', '2024-03-09 20:29:55', '2024-03-09 20:29:55', 0, 0);
INSERT INTO `summary_plan_day` VALUES (119, '2024-03-10', 1, 2, '/0/1/2/', '接待一个初诊全口，沟通了很长时间，回去和家人商量，接待三个复查患者，一个全口试戴，对形态和颜色不满意，沟通下次再进行一次试戴，督促组员邀约，自己打邀约初诊', '上午接待复诊促成交，督促组员留存及邀约', '2024-03-10 20:05:31', '2024-03-10 20:05:31', 0, 0);
