INSERT INTO `summary_plan_day` VALUES (121, '2024-03-12', 1, 2, '/0/1/2/', '上午接待复诊成交，陪同手术，接待半口调牙和多颗复查，下午陪同全口挂盐水，参加市场大会，晚上集体邀约，陪同全口患者戴牙和另一个全口试戴', '明日身体不适休息，中午回院带患者', '2024-03-12 20:44:44', '2024-03-12 20:44:44', 0, 0);
