INSERT INTO `summary_plan_day` VALUES (123, '2024-03-14', 1, 2, '/0/1/2/', '今日休息，关注组员初诊，两个都没成。回去对比考虑', '上午接待两个复查患者取模，下午一个多颗返工戴牙，结束去场地留存，督促组员留存及邀约', '2024-03-14 20:44:34', '2024-03-14 20:44:34', 0, 0);
