INSERT INTO `summary_plan_day` VALUES (126, '2024-03-17', 1, 2, '/0/1/2/', '上午在场地留存，中午回院接待五个复查患者，一个全口返工试戴，一个戴牙了又返工，一个半口调牙，还有另外半口没种，沟通做思想工作尽量让阿姨能把另外半口种了。另接待一个戴牙一个二期。督促组员留存及邀约', '接待之前成交的全口叔叔来种另外半口，督促没初诊的组员现场邀约', '2024-03-17 20:57:06', '2024-03-17 20:57:06', 0, 0);
