INSERT INTO `summary_plan_day` VALUES (144, '2024-04-06', 1, 2, '/0/1/2/', '1:上午接待复查患者，一个半口试戴牙，帮助组员接待两个戴牙患者，接待一个延期患者手术\n2:下午接待一个复诊患者成交，血糖太高回家调养好了再来种\n3:参加赵总会议\n4:督促组员留存及邀约', '1:上午协助新人接待初诊\n2:接待多个复查患者\n3:督促组员留存，没初诊的现场抓初诊', '2024-04-06 20:48:17', '2024-04-06 20:48:17', 0, 0);
INSERT INTO `summary_plan_day` VALUES (145, '2024-04-07', 1, 2, '/0/1/2/', '1:场地留存\n2:打邀约\n3:督促组员留存数量及质量，邀约初诊，落下进度很多，努力追赶', '1:上午协助组员接待初诊\n2:接待复查患者\n3:查看组员工作状态，督促没初诊的现场抓初诊', '2024-04-07 21:03:44', '2024-04-07 21:03:44', 0, 0);
INSERT INTO `summary_plan_day` VALUES (146, '2024-04-08', 1, 2, '/0/1/2/', '1:上午协助新人接待初诊全口未成交，需要去别的医院对比价格，回去跟子女商量\n2:接待自己和组员的复查患者，一个患者因等待时间长，发脾气安抚患者\n3:督促组员留存及邀约', '1:上午接待两个复查患者\n2:组内有初诊促成交\n3:查看组员工作状态，督促现场邀约，追赶进度', '2024-04-08 20:56:28', '2024-04-08 20:56:28', 0, 0);
INSERT INTO `summary_plan_day` VALUES (147, '2024-04-09', 1, 2, '/0/1/2/', '今日休息，督促组员质量留存及邀约，努力追赶进度', '1:上午场地留存\n2:查看组员状态，关注组员留存情况\n3:接待复查患者戴牙', '2024-04-09 20:33:42', '2024-04-09 20:33:42', 0, 0);
INSERT INTO `summary_plan_day` VALUES (148, '2024-04-10', 1, 2, '/0/1/2/', '1:上午场地留存\n2:中午回医院带复查患者戴牙，有颗没戴上\n3:晚上陪患者二期，等待时间较长，安抚患者\n4:督促组员邀约', '1:组内新人有初诊，协助接待促成交\n2:接待全口调牙，戴的牙松动了\n3:下午参加主管会和市场大会', '2024-04-10 20:57:50', '2024-04-10 20:57:50', 0, 0);
INSERT INTO `summary_plan_day` VALUES (149, '2024-04-11', 1, 2, '/0/1/2/', '1:上午协助组员接待初诊未成交，嫌价格贵\n2:接待复查患者\n3:下午参加主管会和市场大会，晚上打邀约\n4:晚上接待全口戴牙', '1:寻场查看组员工作状态\n2:督促组员留存及邀约\n3:协助组员接待初诊', '2024-04-11 21:14:08', '2024-04-11 21:14:08', 0, 0);
INSERT INTO `summary_plan_day` VALUES (150, '2024-04-12', 1, 2, '/0/1/2/', '1:上午场地巡场\n2:回院接待患者咬模\n3:接待患者戴牙\n4:场地留存，督促组员不松懈，追赶进度', '1:组内有初诊，协助促成交\n2:全口患者临时牙大片断裂，接待患者修复，安抚患者\n3:下午参加主管会，复盘初诊未成交原因', '2024-04-12 21:30:36', '2024-04-12 21:30:36', 0, 0);
INSERT INTO `summary_plan_day` VALUES (151, '2024-04-13', 1, 2, '/0/1/2/', '1:接待全口粘临时牙，临时牙大片脱落\n2:协助组员接待初诊未成交，回去考虑.后期跟进\n3:帮助组员接待复查患者咬模，做二期\n4:接待患者拆线，本来还有四颗ITI要种，结果说上次种的太疼了不敢种了\n5:晚上参加闫经理会议，督促组员邀约', '1:组内有初诊促成交\n2:没初诊的现场抓初诊\n3:场地查看组员状态', '2024-04-13 18:54:06', '2024-04-13 18:54:06', 0, 0);
INSERT INTO `summary_plan_day` VALUES (152, '2024-04-14', 1, 2, '/0/1/2/', '1:上午场地留存.，督促组员现场邀约\n2:中午带组员跑市场\n3:下午回院区开会', '1:上午有初诊促成交\n2:接待全口戴牙\n3:场地查看组员状态\n3:督促组员留存及邀约', '2024-04-14 21:11:30', '2024-04-14 21:11:30', 0, 0);
INSERT INTO `summary_plan_day` VALUES (153, '2024-04-18', 1, 2, '/0/1/2/', '1:上午场地留存，督促组员留存及邀约\n2:下午返回医院开会，带领组员打邀约', '1:组内有初诊促成交\n2:接待复查患者二期和咬模\n3:点位查看组员状态，辅助留存及邀约', '2024-04-18 21:18:19', '2024-04-18 21:18:19', 0, 0);
INSERT INTO `summary_plan_day` VALUES (154, '2024-04-19', 1, 2, '/0/1/2/', '1:上午接待初诊和复查患者\n2:协助组员接待初诊和复诊患者，5个没成交，再跟进\n3:督促组员邀约初诊', '1:上午接待初诊促成交\n2:接待多个复查半口咬模戴牙\n3:督促组员现场邀约初诊', '2024-04-19 21:11:23', '2024-04-19 21:11:23', 0, 0);
INSERT INTO `summary_plan_day` VALUES (155, '2024-04-20', 1, 2, '/0/1/2/', '1:接待四个初诊四个复诊全部成交\n2:接待一个全口戴牙，一个半口戴牙，戴的时候基台裂了，弄了很久患者很不满意，另外半口估计不想种了，两个半口取模.接待活动牙返工取模，已返工两次\n3:晚上陪半口患者挂盐水和戴牙\n4:督促组员邀约', '1:上午辅助组员接待初诊\n2:下午接待全口试戴\n3:督促组员留存及邀约，努力追赶进度', '2024-04-20 20:42:53', '2024-04-20 20:42:53', 0, 0);
INSERT INTO `summary_plan_day` VALUES (156, '2024-04-21', 1, 2, '/0/1/2/', '1:接待两个初诊，等待时间较长，陪同安抚。辅助组员初诊成交\n2:接待三个复查患者，一个全口戴牙，一个全口调牙，一个咬模\n3:督促组员留存及邀约，努力追赶进度', '明日休息，跟进组员初复诊', '2024-04-21 21:20:13', '2024-04-21 21:20:13', 0, 0);
INSERT INTO `summary_plan_day` VALUES (157, '2024-04-22', 1, 2, '/0/1/2/', '今日休息，跟进初复诊.督促组员留存及邀约', '1:上午接待初诊\n2:接待复查患者\n3:参加主管会和市场大会\n4:带领组员打邀约', '2024-04-22 19:59:36', '2024-04-22 19:59:36', 0, 0);
INSERT INTO `summary_plan_day` VALUES (158, '2024-04-23', 1, 2, '/0/1/2/', '1:上午接待初诊全口，因为心里预期价格比较低所以未成交，回家再去其他医院对比看看，后期跟进\n2:接待复查患者咬模\n3:接待初诊单颗成交，跟进组员初诊需要延期种植\n4:下午参加主管会和市场大会，晚上带领组员打邀约', '1:上午接待初诊和复诊\n2:辅助组员接待初诊\n3:场地查看组员状态，督促邀约', '2024-04-23 20:14:03', '2024-04-23 20:14:03', 0, 0);
INSERT INTO `summary_plan_day` VALUES (159, '2024-04-24', 1, 2, '/0/1/2/', '1:上午接待复诊成交，陪同手术\n2:辅助组员接待初诊成交两个半口，帮忙带术后\n3:接待患者戴牙\n4:督促组员留存及邀约', '1:场地留存\n2:场地查看组员状态\n3:跟进组员初复诊', '2024-04-24 21:40:24', '2024-04-24 21:40:24', 0, 0);
INSERT INTO `summary_plan_day` VALUES (160, '2024-04-25', 1, 2, '/0/1/2/', '1:上午场地留存\n2:中午返回院区辅助组员带初诊，一个全口未成交，因为心里预期价格太低无法成交，一个多颗未成交要回去多家对比，比较谨慎\n3:下午辅助组员带初诊成交\n4:晚上带领组员打邀约', '1:辅助组员接待初诊促成交\n2:接待全口戴牙.挖掘转介绍\n3:场地查看组员状态.督促留存及邀约', '2024-04-25 20:56:33', '2024-04-25 20:56:33', 0, 0);
INSERT INTO `summary_plan_day` VALUES (161, '2024-04-26', 1, 2, '/0/1/2/', '1:辅助组员接待初诊半口加多颗未成交，回去和女儿商量，后期跟进\n2:接待复诊成交半口，陪同手术，等待时间长，晚上陪同戴牙\n3:接待多个复查患者，一个全口戴牙，一个全口试戴，两个多颗戴牙，一个复查，帮助组员接待复诊\n4:督促组员留存及邀约', '1:组内有初诊促成交\n2:接待多个复查患者，一个半口取模，看能否挖掘另外半口\n3:场地查看组员状态', '2024-04-26 20:49:29', '2024-04-26 20:49:29', 0, 0);
INSERT INTO `summary_plan_day` VALUES (162, '2024-04-27', 1, 2, '/0/1/2/', '1:辅助组员接待初诊全口，回家和家人商量\n2:接待复诊戴牙二开一颗皓圣\n3:接待半口咬模，想开发另外半口，患者想等戴好牙后再弄，接待活动牙返工\n4:督促组员邀约及留存，晚上打邀约', '1:上午接待五个拆线一个半口调牙\n2:辅助组员接待复诊成交，接待自己初诊\n3:下午查看组员状态', '2024-04-27 21:26:43', '2024-04-27 21:26:43', 0, 0);
INSERT INTO `summary_plan_day` VALUES (163, '2024-04-28', 1, 2, '/0/1/2/', '1:上午接待四个患者拆线，开发患者老公成交.\n2:接待患者二期，陪同患者挂盐水，辅助组员收尾款再二开全科，督促组员最后冲刺\n3:晚上培训牙齿美白', '1:上午接待半口拆线调牙，开发另外半口\n2:接待复查患者\n3:场地查看组员状态', '2024-04-28 19:29:22', '2024-04-28 19:29:22', 0, 0);
INSERT INTO `summary_plan_day` VALUES (164, '2024-04-29', 1, 2, '/0/1/2/', '1:接待复诊患者成交半口，陪同挂盐水\n2:接待初诊未成交，回家考虑\n3:接待复查患者二期，三期，晚上陪同半口戴牙\n4:督促组员邀约，最后一天冲刺', '1:明日休息\n2:跟进组员初复诊\n3:督促现场邀约冲刺', '2024-04-29 21:01:39', '2024-04-29 21:01:39', 0, 0);
INSERT INTO `summary_plan_day` VALUES (165, '2024-04-30', 1, 2, '/0/1/2/', '今日休息，跟进组员初复诊，初诊全口未成交没骨头种不了，另一个没钱价格贵', '明日有事休息，跟进初复诊，督促组员月初不松懈', '2024-04-30 18:59:29', '2024-04-30 18:59:29', 0, 0);
INSERT INTO `summary_plan_day` VALUES (166, '2024-05-03', 1, 2, '/0/1/2/', '今日休息，跟进初复诊，督促组员现场邀约，跟进之前初诊未成交患者', '1:接待复查患者\n2:督促组员留存及邀约\n3:场地查看组员状态', '2024-05-03 20:44:44', '2024-05-03 20:44:44', 0, 0);
INSERT INTO `summary_plan_day` VALUES (167, '2024-05-04', 1, 2, '/0/1/2/', '1:上午场地留存\n2:中午回医院带初诊和复诊患者，初诊回去考虑再跟进\n3:下午带三个复查患者二期\n4:督促组员邀约初诊', '1:上午接待一个全口和一个返工患者戴牙\n2:跟进初复诊患者\n3:场地查看组员状态', '2024-05-04 19:40:18', '2024-05-04 19:40:18', 0, 0);
INSERT INTO `summary_plan_day` VALUES (168, '2024-05-05', 1, 2, '/0/1/2/', '1:上午接待全口戴牙，没戴上要返工，接待多颗返工戴牙\n2:下午接待活动牙返工戴牙，接待正畸\n3:督促组员留存及邀约', '1:辅助组员接待复诊和初诊，促成交\n2:接待自己全口戴牙和两个拆线患者\n3:接待自己复诊患者促成交\n4:督促组员留存及现场邀约', '2024-05-05 21:06:34', '2024-05-05 21:06:34', 0, 0);
INSERT INTO `summary_plan_day` VALUES (169, '2024-05-06', 1, 2, '/0/1/2/', '1:上午辅助组员接待两个复诊患者成交半口，接待一个初诊成交，帮忙带术后\n2:接待自己的两个拆线，一个半口调牙，一个全口试戴，接待自己的初诊成交，陪同术后，接待活动牙返工调牙\n3:下午接待自己复诊成交，由于头疼今天付了款明天来手术，接待正畸\n4:督促组员邀约及留存', '1:上午去给患者送临时牙\n2:中午接待患者手术\n3:下午场地查看组员状态，督促留存及邀约', '2024-05-06 21:00:43', '2024-05-06 21:00:43', 0, 0);
